function [63:0] get_abs_val;

  input  [63:0]  quad_vect;

  begin
    if ( (quad_vect[63]) == 1'b0 ) // if quad_vect real positive
      get_abs_val = quad_vect;
    else
      get_abs_val = {1'b0,quad_vect[62:0]};
  end
endfunction
