  always @ ( fin_period or normalized_fb_delay or gla_muxed_delay or GLADELAY )
  begin
     CLKA_2_GLA_dly <= CLKA_TO_REF_DELAY + IN_DIV_DELAY + fin_period - normalized_fb_delay + gla_muxed_delay + OUT_UDIV_DELAY + BYP_GLAMUX_DELAY 
                      + GLADELAY + GLA_DRVR_DELAY;
  end

  always @ ( GLADELAY )
  begin
     CLKA_2_GLA_bypass0_dly <= BYP0_CLK_GL + GLADELAY;
  end

  always @ ( gla_muxed_delay, GLADELAY )
  begin
     CLKA_2_GLA_bypass1_dly <= gla_muxed_delay + OUT_UDIV_DELAY + BYP_GLAMUX_DELAY + GLADELAY + GLA_DRVR_DELAY;
  end

  always @ ( fin_period or normalized_fb_delay or gla_muxed_delay or glb_muxed_delay or GLADELAY or GLBDELAY or OBMUX_ipd)
  begin
    if ( OBMUX_ipd !== 3'b011 )
      CLKA_2_GLB_dly <= CLKA_TO_REF_DELAY + IN_DIV_DELAY + fin_period - normalized_fb_delay + glb_muxed_delay + OUT_VDIV_DELAY + BYP_GLBMUX_DELAY + GLBDELAY + GLB_DRVR_DELAY;
    else
      if ( (OAMUX_ipd === 3'b000) && (BYPASSA_ipd === 1'b1) )
        CLKA_2_GLB_dly <= BYP0_CLK_GL - GLA_DRVR_DELAY + GLADELAY + glb_muxed_delay + OUT_VDIV_DELAY + BYP_GLBMUX_DELAY + GLBDELAY + GLB_DRVR_DELAY;
      else if ( OAMUX_ipd === 3'b001 )
        CLKA_2_GLB_dly <= gla_muxed_delay + OUT_UDIV_DELAY + BYP_GLAMUX_DELAY 
                          + GLADELAY + glb_muxed_delay + OUT_VDIV_DELAY + BYP_GLBMUX_DELAY + GLBDELAY + GLB_DRVR_DELAY;
      else begin
        CLKA_2_GLB_dly <= CLKA_TO_REF_DELAY + IN_DIV_DELAY + fin_period - normalized_fb_delay + gla_muxed_delay + OUT_UDIV_DELAY + BYP_GLAMUX_DELAY 
                          + GLADELAY + glb_muxed_delay + OUT_VDIV_DELAY + BYP_GLBMUX_DELAY + GLBDELAY + GLB_DRVR_DELAY;
      end
  end
  
