  end

  always @ ( glb_muxed_delay )
  begin
     CLKB_2_YB_bypass1_dly  <= glb_muxed_delay + OUT_VDIV_DELAY + Y_DRVR_DELAY;
  end

  always @ ( fin_period or normalized_fb_delay or glc_muxed_delay or GLCDELAY )
  begin
     CLKA_2_GLC_dly <= CLKA_TO_REF_DELAY + IN_DIV_DELAY + fin_period - normalized_fb_delay + glc_muxed_delay + OUT_WDIV_DELAY + BYP_GLCMUX_DELAY 
                        + GLCDELAY + GLC_DRVR_DELAY;
