     CLKA_2_YC_dly <= CLKA_TO_REF_DELAY + IN_DIV_DELAY + fin_period - normalized_fb_delay + glc_muxed_delay + OUT_WDIV_DELAY + Y_DRVR_DELAY;
  end

  always @ ( glc_muxed_delay )
