               end
					endcase
					
					// Check for Write from Port A and Read from Port B to the same address, read data on Port B is driven to X
					if ( (WENA_lat == 1'b0) && same_addr(ADDRA, ADDRB, {WIDTHA1,WIDTHA0}, {WIDTHB1,WIDTHB0}) &&
